import React from "react";
import styled from "styled-components";

const Score = (props) => {
    return (
        <Container>
            <ScoreCircle />
            <ScoreCircle />
            <ScoreCircle />
            <ScoreCircle />
            <ScoreCircle />
        </Container>
    );
}
const Container = styled.div`
    text-align: center;
`;

const ScoreCircle = styled.div`
    width: 30px;
    height: 30px;
    display: block;
    background-color: yellow;
`;

export default Score;
